        "id": 1682646946138,
        "content": "> 时维五月，准备来一场山西摩旅。北京找工作，前途未卜。忘却烦心事，说走就走吧。\n\n# 大同\n第一站打算前往大同。截止到目前，当地的酒店价格已经成集合倍数增长。\n没有工作的我，住店肯定是住不起了。为了节约开支，我不得不选择住帐篷。\n五一期间，大同的气温徘徊在0到20度，昼夜温差比较大。只要做好保暖措施，问题不会很大。这次打算轻装出行，只带上露营的装备。旅途的伙食就在当地解决，还能体验一下山西的美食。![Description](https://gimg2.baidu.com/image_search/src=http%3A%2F%2Fsafe-img.xhscdn.com%2Fbw%2Ff1392c58-bbe1-4af6-abbb-42a6adebbe60%3FimageView2%2F2%2Fw%2F1080%2Fformat%2Fjpg&refer=http%3A%2F%2Fsafe-img.xhscdn.com&app=2002&size=f9999,10000&q=a80&n=0&g=0n&fmt=auto?sec=1685238868&t=eb411e8d38465ba8f2b5dc3a6c4fa06d)\n\n\n# 五台山\n第二站其实并没有想好，暂且就先去五台山吧。我个人对烧香拜佛没有信仰。倒霉才上挂摊，人生遭遇不顺，才知道烧香拜佛，是不是有点晚了。这次出游，去哪都行，重要的是骑着摩托在路上。![Description](https://img1.baidu.com/it/u=1952730895,2703609012&fm=253&fmt=auto&app=138&f=JPEG?w=667&h=500)\n",
