        "id": 1682656098589,
        "content": "# 摘抄记录---关于摇滚\n> 摇滚是一种音乐表现风格，而非类别，这种风格有一个非充分的必要条件：直抒胸臆。能够达到这个精神的歌，才有可能算在摇滚的范围内。\n\n> 摇滚不等于吵闹，也不等于嘶吼，它甚至可以很抒情。这是很多伪摇滚为什么是伪摇滚的原因之一。摇滚的编曲可以复杂，也可以简单，但必须拜托匠气。这个条件同样可以撕下不少“摇滚”的脸皮。而且，摇滚歌对歌词的要求比其他类别的流行歌曲更高。隽永或者直白，都有文采；深刻或者隐晦，都有内涵；丰富或者悠远，都有意蕴。可以说，优秀的摇滚歌的歌词，可以称为现代诗。",
        "title": "什么样的音乐才算摇滚？",
        "update": "2023/4/28 12:28:18",
